import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { VscIconName } from 'react-icons/vsc';
import { FiIconName } from 'react-icons/fi';
import { BsIconName } from 'react-icons/bs';
import { MdIconName } from 'react-icons/md';
import { AiIconName } from 'react-icons/ai';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Zone from './Zone';
import City from './City'
import Home from './Home';



import Sidebar from './Sidebar';


/*zone */


/*zone */


function App() {
  return (
    <div className="app-container container-fluid">
      <div className="row flex-nowrap">

        <Sidebar></Sidebar>
        <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/cities" element={<City />} />
        <Route path="/zones" element={<Zone />} />

        </Routes>

      </div>
    </div>
  );
}

export default App;
